    private String id;
    private String xapth;
    private String description;

    GDSConfigParameter(String id, String xpath, String description) {
        this.xapth = xpath;
        this.description = description;
    }

    public String getId() {
        return id;
    }

    public String getXapth() {
        return xapth;
    }

    public String getDescription() {
        return description;
    }

